import React from 'react';

const FriendItem = ({item}) => {
    return (
        <li>
            <p>
                <img src={item.image}/>
            </p>
            <div>
                <strong>이름 : {item.name}</strong>
                <span>나이 :{item.age}</span>
            </div>
        </li>
    );
};

export default FriendItem;
